      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( 23 * + - ( - col2 ) * + + 93 * + 80 ) >= ( - ( - CAST ( col2 AS INTEGER ) ) * col2 );
  - name: tab2

outputs:
  - name: q2096.out
    data: |
